class MSeE(torch.nn.Module):
    def __init__(self, mode=0, N=2047):
        super(MSeE, self).__init__()
        if mode in range(5):
            self.mode=mode
        else:
            raise ValueError(f"Invalid loss type {mode}.")
        match self.mode:
            case 0:
                # a simple first order pre-emphasis (simple high pass)
                self.a=torch.tensor([1, 0])
                self.b=torch.tensor([1, -0.85])
            case 1:
                # a simple first order pre-emphasis (simple low pass)
                self.a=torch.tensor([1, 0,])
                self.b=torch.tensor([1, 0.85])
            case 2:
                # folded differentiator
                self.a=torch.tensor([1, 0, 0])
                self.b=torch.tensor([1, 0, -0.85])
            case 3:
                # closer to A-weight
                # taken from a pdf online, but likely not very usable
                self.a=torch.tensor([1, -1.31861375911, 0.32059452332])
                self.b=torch.tensor([0.95616638497, -1.31960414122, 0.36343775625])
            case 4:
                # outer and middle ear
                # can be made by approximation of the weighting function in ITU_T BS.1387 pg. 35
                a=np.zeros(N)
                a[0]=1
                self.a=torch.from_numpy(a).type(torch.float)
                self.b=torch.from_numpy(wf.Acurve(N=N)).type(torch.float)
            case _:
                raise ValueError(f"Invalid loss type {self.mode}.")

    def forward(self, predictions, targets):
        """
        Args:
            predictions (torch.Tensor): The model's predictions.
            targets (torch.Tensor): The ground truth labels or targets.

        Returns:
            torch.Tensor: The computed MSeE loss value.
        """
        predictions = self.preem(predictions)
        targets = self.preem(targets)
        
        return torch.mean((predictions - targets)**2)
    
    def preem(self, x):
        #x = torch.nn.functional.conv1d(x.unsqueeze(1), kernel, padding=1).squeeze(1)
        x=torchaudio.functional.filtfilt(x,self.a,self.b,clamp=True) # time must be the last dim of x
        return x

class cepdist(torch.nn.Module):
    def __init__(self, mode='linear', wlen=128, wstep=64, fs=44100, p=2.0):
        super(cepdist, self).__init__()
        if mode in ['linear', 'mel', 'plp']:
            self.mode=['linear', 'mel', 'plp'].index(mode)
        else:
            raise ValueError(f"Invalid cepstrum type {mode}.")
        self.p=p
        self.wlen=wlen
        self.wstep=wstep
        self.fs=fs
        if self.mode:
            self.onesided=True
        else:
            self.onesided=False

    def forward(self, predictions, targets):
        predictions = self.cep(predictions)
        targets = self.cep(targets)

        distmat = torch.cdist(predictions, targets, p=self.p)

        return torch.mean(distmat, dim=(1,2))
    
    def cep(self, x):
        
        spec_tf=torchaudio.transforms.Spectrogram(n_fft=self.wlen,
                                                  hop_length=self.wstep,
                                                  window_fn=torch.hann_window,
                                                  power=2,
                                                  normalized=False,
                                                  onesided=self.onesided)
        X=spec_tf(x)
            # return a matrix with spectra in columns (wlen, wnum)
        match self.mode:
            case 0:
                # normal power cepstrum
                Xl=torch.log(X)
                if len(Xl.shape) == 2:
                    Xl = Xl.unsqueeze(0)
            case 1:
                mfcc = torchaudio.transforms.MFCC(sample_rate=self.fs,
                                                  n_mfcc=40,
                                                  dct_type=2,
                                                  norm='ortho',
                                                  log_mels=False,
                                                  melkwargs={'n_fft':self.wlen,
                                                             'hop_length':self.wstep,
                                                             'n_mels':40,
                                                             'center':False})
            #case 2:
                # PLPCC
            case _:
                raise ValueError(f"Invalid loss type {self.mode}.")
        if self.mode==0:
            cx = torch.real(torch.fft.ifft(Xl, n=None, dim=1, norm="backward"))
            cx = cx[:,0:(self.wlen//2)+1,:]
        elif self.mode==1:
            cx=mfcc(x)
        else:
            cx = torch.transpose(torch.matmul(torch.transpose(torch.squeeze(Xl), 0, 1), ceps_tf), 0, 1)
        return cx

class PEAQ(torch.nn.Module):
    def __init__(self):
        super(PEAQ, self).__init__()
    
    def forward(self, predictions, targets):
        # come up with a playback level estimation
        t_ep, t_mp, t_modEl, t_cb, t_sp = self.pem(predictions)
        r_ep, r_mp, r_modEl, r_cb, r_sp = self.pem(targets)

        # error signal
        np = self.crit_group(torch.abs((torch.abs(r_sp[:,:,3:769])-torch.abs(t_sp[:,:,3:769])))**2)
        
        # masker
        t_msk = self.calc_mask(t_ep)
        r_msk = self.calc_mask(r_ep)

        t_slp = self.pat_adap_LP(t_ep)
        r_slp = self.pat_adap_LP(r_ep)
            # low passed excitation patterns
        t_slp, r_slp = self.lev_adap(t_slp, r_slp)
            # level adaptation
        t_Ep, r_Ep = self.pat_adap(t_slp, r_slp)
            # spectrally adapted patterns E_{P,x}
        
        # specific loudness patterns
        Nt, Eth = self.calc_loud(t_ep)
        Nr, _ = self.calc_loud(r_ep)

        # probably unnecessary
        #t_epa = self.calc_adap(t_ep)
        #r_epa = self.calc_adap(r_ep)

        MOVs = self.calc_MOV(t_mp, r_mp, r_modEl, Eth, t_Ep, r_Ep, 20*torch.log10(torch.abs(t_sp)), 20*torch.log10(torch.abs(r_sp)), np, r_msk.transpose(1,2), t_ep, r_ep, torch.abs(torch.abs(r_sp)-torch.abs(t_sp)))



    def pem(self, x):
        nfft = int(np.floor(2048*(441/480)))
        step = int(nfft//2)+1

        imin = 3
        imax = 769
            # to remove unnecessary spectral content

        if len(x.shape) == 1:
            x = x.unsqueeze(0)

        # cut up into 2048* sample windows and apply Hann window
        # *wlen adjusted to 44.1 kHz fs to keep frequency resolution as similar as possible
        nwin = int(np.ceil((x.shape[1]-nfft)/step)+1)
        xw_nw = torch.zeros(x.shape[0], nwin, nfft, dtype=torch.double)
        for i in range(nwin-1):
            xw_nw[:, i, :] = x[:,i*step:(i*step)+nfft]*torch.hann_window(nfft, periodic=False)
        xw_nw[:,nwin-1,:x.shape[1]-(nwin-1)*step]=x[:,(nwin-1)*step:]
        xw_nw[:,nwin-1,:] = xw_nw[:,nwin-1,:]*torch.hann_window(nfft, periodic=False)

        # fft
        xw_nw = torch.fft.rfft(xw_nw, n=nfft, dim=2, norm='forward')  # check dimensionality
            # may be replaced with torch.stft()
            # ! ITU-R BS.1387-2 specifies normalization by 1/nfft
        #xw_nw = xw_nw[:,:,imin:imax]
            #done later
        #print(xw_nw.shape) # Batch x wnum x spectrum length

        # rectification
            # probably solved by the torch.abs() in weighting step?

        #scaling of the input signals
        Lp = 92                                                 # default value
        normfac = 1                                             # revisit
        print('##################\ninput signal scaling likely wrong!\n##################')
        fac = (10**(Lp/20))/normfac
        xw_nw = xw_nw[:,:,:942]*fac

        # outer and middle ear weighting function
        f = np.linspace(0,44100,int(2048*(441/480)),endpoint=False)
            # approximately f = k*23.4375
        f = f[imin:imax]
        W = -0.6*3.64*((f/1000)**(-0.8)) + 6.5*np.exp(-0.6*((f/1000)-3.3)**2) - (1e-3)*(f/1000)**3.6
        xw = torch.abs(xw_nw[:,:,imin:imax])*torch.from_numpy(10**(W/20))
            # this should work fine

        # critical band grouping
        xw = self.crit_group(torch.abs(xw)**2)

        # adding internal noise
        fc = wf.f_c()
        W = 10**(0.4*0.364*((fc/1000)**(-0.8)))
        uep = xw + torch.matmul(torch.ones(xw.shape, dtype=torch.double), torch.diag(W))

        # frequency domain spreading
        uep = self.freq_smear(fc, uep)
            # changes dim to batch x frequency x time
        mp, mod_eline = self.calc_mod(uep)

        # time domain spreading
        tau = 0.008+(2.2/fc)
        a_vec = np.exp(-4/(187.5*tau))
        ep = torch.zeros(uep.shape)
        for i in range(1, ep.shape[-1]):
            ep[:,:,i] = ep[:,:,i-1]*a_vec + uep[:,:,i]*(1-a_vec)
            # inefficient for longer signals, revisit later
        #for i, a in enumerate(a_vec):
        #    print(a)
        #    ep[:,i,1:] = torchaudio.functional.lfilter(uep[:,:,1:],a,1-a,clamp=False)
            # shows an error I could not solve
        ep=torch.maximum(ep,uep)

        return ep, mp, mod_eline, xw, xw_nw
    
