    def freq_smear(self, fc, uep):
        L = 10*torch.log10(uep)
        Su = -24-(230/fc)+0.2*L
            # only works as long as number of bands is last dimension of L
        Sl = 27     # lower slope is a constant
        res = 0.25  # Bark scale resolution in case of 109 bands
        Z = 109     # maximum of j (number of frequency bands) 
        
        Eline = torch.zeros((uep.shape[0], uep.shape[2], uep.shape[2], uep.shape[1]), dtype=torch.double)
        Ecurl = torch.zeros((uep.shape[0], uep.shape[2], uep.shape[2]), dtype=torch.double)

        for j in range(109):                    # across frequency bands
            idx1 = torch.zeros(Z, dtype=torch.double)
            idx2 = torch.zeros(Z, dtype=torch.double)
            idx1[:j]=1
            idx2[j:]=1
            mu = torch.tensor(range(Z))
            d1 = torch.sum((10**((-res*(j-mu)*Sl*idx1)/10))*idx1)
            for n in range(uep.shape[1]):       # across windows (time)
                d2 = torch.sum((10**(torch.einsum('i,bj->bji',res*(mu-j)*idx2, Su[:,:,j])/10))*idx2, dim=2)
                for k in range(109):            # across frequency bands again
                    if k<j:
                        Eline[:,j,k,n] = (uep[:,n,k]*(10**(-res*(j-k)*Sl))/10)/(d1+d2[:,n])
                        Ecurl[:,j,k] = (10**((-res*(j-k)*Sl)/10))/(d1+d2[:,0])
                    else:
                        Eline[:,j,k,n] = (uep[:,n,k]*(10**(res*(k-j)*Su[:,n,k]))/10)/(d1+d2[:,n])
                        Ecurl[:,j,k] = (10**((res*(k-j)*Su[:,n,0])/10))/(d1+d2[:,0])

        NormSP_inv = 1/(torch.sum(Ecurl**0.4, dim=1)**(1/0.4))
        
        E2 = torch.transpose(torch.sum(Eline**0.4, dim=1)**(1/0.4),0,2)*torch.t(NormSP_inv)

        return torch.transpose(E2,0,2)

    def calc_mask(self, x):
        res = 0.25

        m = 3*torch.ones(x.shape, dtype=torch.double)
        m[:,int(np.ceil(12/res)):,:]=0.25*torch.arange(np.ceil(12/res),x.shape[1], dtype=torch.double).unsqueeze(-1)*res

        return x/(10**(m/10))

    def pat_adap_LP(self, x):
        fc = wf.f_c()
        tau = 0.008 + (4.2/fc)
        a = np.exp(-(int((int(np.floor(2048*(441/480))))//2)+1)/(44100*tau))

        P = torch.zeros(x.shape)
        P[:,:,0] = x[:,:,0]*(1-a)
        for i in range(1, P.shape[-1]):
            P[:,:,i] = P[:,:,i-1]*a + x[:,:,i]*(1-a)
        
        return P
    
    def Lev_Corr(self, Pt, Pr):
        LC = (torch.sum(torch.sqrt(Pt*Pr), dim=1)/torch.sum(Pt, dim=1))**2
        #LC[LC>1] = 1/LC[LC>1]
        return LC.repeat(Pr.shape[1],1,1).transpose(1,0)
    
    def lev_adap(self, Pt, Pr):
        LevCorr = self.Lev_Corr(Pt, Pr)
        Pt[LevCorr<1] = Pt[LevCorr<1]*LevCorr[LevCorr<1]
        Pr[LevCorr>1] = Pr[LevCorr>1]/LevCorr[LevCorr>1]
        return Pt, Pr
    
    def pat_adap(self, Et, Er):
        fc = wf.f_c()
        tau = 0.008 + (4.2/fc)
        a = np.exp(-(int((int(np.floor(2048*(441/480))))//2)+1)/(44100*tau))
        a = a.repeat(Et.shape[-1],1).transpose(0,1)
        mask = torch.zeros(Et.shape)
        R = torch.zeros(Et.shape, dtype=torch.double)
        for n in range(R.shape[-1]):
            mask[:,:,-n-1]=1
            numer = torch.sum(mask*Et*Er*torch.fliplr(a**torch.arange(0,Et.shape[-1])), dim=2)
            denom = torch.sum(mask*Er*Er*torch.fliplr(a**torch.arange(0,Et.shape[-1])), dim=2)
            R[:,:,n] = numer/denom
                # ! need to fix situations where denom is 0
        a = np.exp(-(int((int(np.floor(2048*(441/480))))//2)+1)/(44100*tau))
            # returned to minimal size for later use
        
        Rt = torch.ones(R.shape, dtype=torch.double)
        Rr = torch.ones(R.shape, dtype=torch.double)
        Rt[R>1] = 1/R[R>1]
        Rr[R<1] = R[R<1]

        M = 8
        M1 = 3
        M2 = 4
        for k in range(R.shape[1]):
            Rt[:,k,:] = torch.sum(Rt[:,max(k-M1, 0):min(k+M2,R.shape[1]-1),:], dim=1)/M
            Rr[:,k,:] = torch.sum(Rr[:,max(k-M1, 0):min(k+M2,R.shape[1]-1),:], dim=1)/M
        
        PCt = torch.zeros(R.shape)
        PCr = torch.zeros(R.shape)

        PCt[:,:,0] = (1-a)*Rt[:,:,0]
        PCr[:,:,0] = (1-a)*Rr[:,:,0]
        for n in range(1,PCt.shape[-1]):
            PCt[:,:,n] = a*PCt[:,:,n-1]+(1-a)*Rt[:,:,n]
            PCr[:,:,n] = a*PCr[:,:,n-1]+(1-a)*Rr[:,:,n]
        
        return Et*PCt, Er*PCr
    
    def calc_mod(self, x):
        fc = wf.f_c()
        tau = 0.008 + (4.2/fc)
        a = np.exp(-(int((int(np.floor(2048*(441/480))))//2)+1)/(44100*tau))

        Eder = torch.zeros(x.shape, dtype=torch.double)
        El = torch.zeros(x.shape, dtype=torch.double)
        Eder[:,:,0] = (1-a)*(44100/((((np.floor(2048*(441/480))))//2)+1))*torch.abs(x[:,:,0]**0.3)
        El[:,:,0] = (1-a)*(x[:,:,0]**0.3)
        for n in range(1,x.shape[-1]):
            Eder[:,:,n] = a*Eder[:,:,n-1] + (1-a)*(44100/((((np.floor(2048*(441/480))))//2)+1))*torch.abs(x[:,:,n]**0.3 - x[:,:,n-1]**0.3)
            El[:,:,n] = a*El[:,:,n-1] + (1-a)*(x[:,:,n]**0.3)
        Mod = Eder/(1+(El/0.3))
        return Mod, El
    
    def calc_loud(self, E):
        print('Assuming atn() in paper means arc tangent!')
        f =  wf.f_c()
        Eth = 10**(0.364*(f/1000)**(-0.8))
        s = 10**((-2-2.05*torch.arctan(f/4000)-0.75*torch.arctan((f/1600)**2))/10)
        N = 1.07664*((Eth/(s*(10**4)))**0.23)*(((1-s+(s*torch.transpose(E, 1,2))/Eth)**0.23)-1)
        return (25/N.shape[1])*torch.sum(torch.clamp(N, min=0), dim=2), Eth
    
    def calc_MOV(self, t_mp, r_mp, r_modEl, Eth, t_Ep, r_Ep, tF, rF, Pnoise, Mask, t_ep, r_ep, F0):
        # Need to calculate:
        #   WinModDiff1_B
        #   AvgModDiff1_B
        #   AvgModDiff2_B
        #   RmsNoiseLoud_B
        #   BandwidthRef_B
        #   BandwidthTest_B
        #   Total NMR_B
        #   RelDistFrames_B
        #   MFPD_B
        #   ADB_B
        #   EHS_B
        print('calc_MOV WIP')
        MD1B = self.ModDiff(t_mp, r_mp, 1, 1)
        TempWt = torch.sum(r_modEl.transpose(1,2)/(r_modEl.transpose(1,2)+100*Eth), dim=2)
        WinModDiff1_B = self.WinX(MD1B)
        AvgModDiff1_B = self.AvgX(MD1B, W=TempWt)
        AvgModDiff2_B = self.AvgX(self.ModDiff(t_mp, r_mp, 0.1, 0.01), W=TempWt)

        st = 0.15*t_mp.transpose(1,2)+0.5
        sr = 0.15*r_mp.transpose(1,2)+0.5
        #beta = torch.exp(-1.5*(t_Ep-r_Ep)/r_Ep)
        #NL = ((Eth/st)**0.23)*(((1+torch.clamp(st*t_Ep-sr*r_Ep,min=0)/(Eth+sr*r_Ep*beta))**0.23)-1)
        NL = ((Eth/st)**0.23)*(((1+torch.clamp(st*t_Ep.transpose(1,2)-sr*r_Ep.transpose(1,2),min=0)/(Eth+sr*r_Ep.transpose(1,2)*torch.exp(-1.5*(t_Ep-r_Ep)/r_Ep).transpose(1,2)))**0.23)-1)
        RmsNoiseLoud_B = self.RmsX(NL)
        # may not be completely correct, returns fband dependent result

        #Bandwidth
        bwt, bwr = self.BWidth(tF, rF)
        BandWidthRef_B = self.batchmeanmin1(bwr, gr=346)
        BandWidthTest_B = self.batchmeanmin1(bwt, con=bwr, gr=346)

        PoverM = Pnoise/Mask
        NMR_B = 10*torch.log10(torch.sum(torch.sum(PoverM, dim=2)/Pnoise.shape[2], dim=1)/Pnoise.shape[1])

        RelDistFrames_B = self.RDF(10*torch.log10(PoverM))

        MFPD_B, ADB_B = self.mfpd_adb(10*torch.log10(t_ep), 10*torch.log10(r_ep))

        EHS_B = self.ehs(F0)

        return WinModDiff1_B, AvgModDiff1_B, AvgModDiff2_B, RmsNoiseLoud_B, BandWidthRef_B, BandWidthTest_B, NMR_B, RelDistFrames_B, MFPD_B, ADB_B

    def ModDiff(self, xt, xr, negWt, offset):
        if negWt != 1:
            w = torch.ones(xt.shape)
            w[xt<xr]=negWt
        else:
            w=1
        md = w*torch.abs(xt-xr)/(offset+xr)
        return 100*torch.sum(md, dim=1)/xt.shape[1]

    def BWidth(self, FLTst, FLRef):
        print('BWidth WIP')
        
        ZeroThreshold = FLTst[:,:,921:].max(dim=2).values
        BWRef = torch.empty(FLTst.shape[0::2])
        BWTst = torch.empty(FLTst.shape[0::2])
        for n in range(FLRef.shape[1]):
            nzs = (FLRef[:,n,:921].transpose(0,1)>=10+ZeroThreshold[:,n]).nonzero()
            for b in range(FLRef.shape[0]):
                BWRef[b,n] = torch.max(nzs[nzs[:,1]==b])+1
                BWTst[b,n] = torch.max((FLTst[b,n,:int(BWRef[b,n])]>=5+ZeroThreshold[b,n]).nonzero())+1
        return BWTst, BWRef

    def RDF(self, x):
        xm = x.max(dim=2).values
        rdf = torch.empty(x.shape[0])
        for b in range(x.shape[0]):
            rdf[b] = xm[b,xm[b,:]>=1.5].shape[0]
        return rdf

    def mfpd_adb(self, tE, rE):
        Lkn = 0.3*torch.maximum(rE,tE)+0.7*tE
        s = 1e30*torch.ones(Lkn.shape, dtype=torch.double)
        s[Lkn>0] = 5.95072*((6.39468/Lkn[Lkn>0])**1.71332)+(9.01033e-11)*(Lkn[Lkn>0]**4)+(5.05622e-6)*(Lkn[Lkn>0]**3)-0.00102438*(Lkn[Lkn>0]**2)+0.0550197*Lkn[Lkn>0]-0.198719
        e = rE-tE
        a = (10**(-0.5213902276543247/(6-2*(e>0).short())))/s
        pc = 1-10**(-a*(torch.pow(e,(6-2*(e>0).short()))))
        qc = torch.abs(e.long())/s          # this is likely wrong
        print('qc calculation may be wrong')
        Pc = 1-torch.prod(1-pc, dim=1)
        Qc = torch.sum(qc, dim=1)

        Pc_curl = torch.empty(Pc.shape)
        Pc_curl[0] = 0
        c0 = 0.9**(941/1881)            # should be ~equal to step_size/nfft
        #c1 = 0.99**(941/1881)
        c1 = 1                          # page 63, idk man
        PMc = torch.zeros(Pc_curl.shape[0], 2)
        for i in range(1,Pc_curl.shape[1]):
            Pc_curl[:,i] = (1-c0)*Pc[:,i]+c0*Pc_curl[:,i-1]
            PMc[:,1] = torch.maximum(c1*Pc_curl[:,i], PMc[:,0])
            PMc[:,0] = PMc[:,1]
        MFPD = PMc[:,-1]
        Qsum = torch.sum(Qc, dim=1)
        ADB = torch.empty(Qsum.shape[0])
        for i in range(Qsum.shape[0]):
            if (Pc[i,Pc[i,:]>0.5]).shape[0] > 0: # ndist
                if Qsum[i] > 0:
                    ADB[i] = np.log10(Qsum[i]/(Pc[i,Pc[i,:]>0.5]).shape[0])
                else:
                    ADB[i] = -0.5
            else:
                ADB[i] = 0

        return MFPD, ADB
            
    def ehs(self, x):
        print('WIP')
        fc = wf.f_c()
        maxlag = 2**torch.floor(torch.log2((fc/22050)*941))

        ehs = torch.empty(x.shape[0], 109)
        for band in range(109):
            C = torch.zeros(x.shape[0], maxlag[band])
            for lag in range(maxlag[band]):
                x_t = torch.cat(torch.zeros(x.shape[0], lag), x[:,:maxlag[band]-lag], dim=1)
                C[lag] = (x*x_t)/(torch.abs(x)*torch.abs(x_t))
            C = C*torch.hann_window(maxlag[band])
            C = C-torch.mean(C, dim=1)
            C_ft = 20*torch.log10(torch.abs(torch.fft.rfft(C, dim=1, norm='forward')))
            ehs[:, band] = self.ehs_peak(C_ft)


    def AvgX(self, x, W=None):
        if W==None:
            N = x.shape[1]
        else:
            N = torch.sum(W)
            x = x*W
        return torch.sum(x, dim=1)/N
    
    def RmsX(self, x, W=None, Z=1):
        if W==None:
            N = x.shape[1]**2
        else:
            N = torch.sum(W)**2
            x = (x*W)**2
        return np.sqrt(Z)*torch.sqrt(torch.sum(x, dim=1)/N)

    def WinX(self, x):
        WA = torch.zeros(x.shape[0])
        for i in range(x.shape[1]-1, 2, -1):
            WA += (torch.sum(torch.sqrt(x[:, i-2:i+1]), dim=1)/4)**4
        return torch.sqrt(WA/(x.shape[1]-3))
        
    def batchmeanmin1(self, x, con=None, gr=None):
        '''
        Assumes first dim to be batch
        '''
        if con==None:
            con = x
        mn = torch.empty(x.shape[0])
        for i in range(x.shape[0]):
            mn[i] = torch.mean(x[i,con[i,:]>gr])
        return mn

    def ehs_peak(self, x):
        print('WIP, copied from torch forum!')
        # getting short signals out of the way
        if x.shape[1]<4:
            return torch.max(x,dim=1)
        if x.shape[1]<16:
            return torch.max(x[:,1:],dim=1)
        
        # detecting peaks for reasonable length signals (16 or more samples)
        width = 15
